    const onSubmitForm = async(e)=>{
        e.preventDefault();
        try {
            const body = {select};
            const response = fetch("http://localhost:5321/game/get/",{
                method:"POST",
                headers:{"Content-Type":"application/json"},
                body:JSON.stringify(body)
            });
            console.log(response);
        } catch (error) {
            console.log("error")
            console.log(error.message)
        }
    }
